Ogden cami and I were NOT friends. I bought this pattern at the beginning of my garment making journey, and it did not go well. First of all, everyone was gushing about what a good scrap buster it is. So I got the pattern hoping I could squeeze it into whatever decently big remnant I had, and it turned out more complicated than I thought. Then I struggled with the straps assembly. My sewing technique was not very precise, I had picked the most slippery viscose I could find, it was a nightmare. I also had picked the wrong size because I did not understand bust measurements. So I hated it. I watched Instagram ravel about the pattern and was ruminating in my corner. 
I picked it up recently while I was sorting my pattern stash. First I measured the pattern pieces and realized my sizing mistake. Then I found a stable gauze and marked all the seam allowances around the straps inserts. And tadaaa ! Now I can finally say that I am a normal insta sewist and like the Ogden Cami!
I guess the moral of the story is, if you got mad after a pattern that you tried in your young sewing age, it might be worth revisiting sometimes. 
☀️ 
Have a good relaxing weekend guys! I know I’m ready for a long one. And a hair cut too 😂
☀️ 
